import React from "react";
import styled from "styled-components";

const Home = () => {
  <div>
    <div className="search">
      <h1>Search for events through either Zip Code or City, State</h1>
      <input placeholder="'10002' or 'Brooklyn, New York'"></input>
    </div>
  </div>;
};

export default Home;
